import React from "react";
import { Text, View, Image, StyleSheet } from "react-native";
import icon from "./assets/icon.png";

function App() {
  return (
    <View style={styles.root}>
      <Text style={{ fontSize: 30, fontWeight: "bold" }}></Text>
      <Image
        style={{ width: 500, height: 500, backgroundColor: "red" }}
        resizeMode="cover"
        source={{
          uri: "https://images.unsplash.com/photo-1678172341193-39db23fee6f1?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80",
        }}
      />
      <Text>Hello boys</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  root: { flex: 1, justifyContent: "center", alignItems: "center" },
});

export default App;
